(1, '2014-10-27', 'Notice', 'https://s3.amazonaws.com/public-inspection.federalregister.gov/2014-25412.pdf?1414155000', 'https://www.federalregister.gov/articles/2014/10/27/2014-25412/quarterly-publication-of-individuals-who-have-chosen-to-expatriate-as-required-by-section-6039g', 'http://www.gpo.gov/fdsys/pkg/FR-2014-10-27/pdf/2014-25412.pdf', 'https://www.federalregister.gov/articles/xml/201/425/412.xml', '<NOTICE>\n      <PREAMB>\n        <AGENCY TYPE="S">DEPARTMENT OF THE TREASURY</AGENCY>\n        <SUBAGY>Internal Revenue Service</SUBAGY>\n        <SUBJECT>Quarterly Publication of Individuals, Who Have Chosen To Expatriate, as Required by Section 6039G</SUBJECT>\n        <AGY>\n          <HD SOURCE="HED">AGENCY:</HD>\n          <P>Internal Revenue Service (IRS), Treasury.</P>\n        </AGY>\n        <ACT>\n          <HD SOURCE="HED">ACTION:</HD>\n          <P>Notice.</P>\n        </ACT>\n        <SUM>\n          <HD SOURCE="HED">SUMMARY:</HD>\n\n          <P>This notice is provided in accordance with IRC section 6039G of the Health Insurance Portability and Accountability Act (HIPPA) of 1996, as amended. This listing contains the name of each individual losing United States citizenship (within the meaning of section 877(a) or 877A) with respect to whom the Secretary received information during the quarter ending September 30, 2014. For purposes of this listing, long-term residents, as defined in section 877(e)(2), are treated<PRTPAGE P="64014"/>as if they were citizens of the United States who lost citizenship.</P>\n        </SUM>\n        <GPOTABLE CDEF="xl50,xl50,xl50" COLS="3" OPTS="L2,tp0,i1">\n          <TTITLE/>\n          <BOXHD>\n            <CHED H="1">Last name</CHED>\n            <CHED H="1">First name</CHED>\n            <CHED H="1">Middle name/initials</CHED>\n          </BOXHD>\n          <ROW>\n            <ENT I="01">ABDALLA</ENT>\n            <ENT>OSAMA</ENT>\n            <ENT>ELSIR</ENT>\n          </ROW>\n          <ROW>\n            <ENT I=