ernal Revenue Service","id":254}]', '00-32487', 'This notice is provided in accordance with IRC section 6039G, as amended, by the Health Insurance Portability and Accountability Act (HIPPA) of 1996. This listing contains the name of each individual losing United States citizenship (within the meaning of section 877(a)) with respect to whom the Secretary received information during the quarter ending September 30, 2000.', NULL),
(61, '2000-09-22', 'Notice', NULL, 'https://www.federalregister.gov/articles/2000/09/22/00-24442/proposed-collection-comment-request-for-form-8854', 'http://www.gpo.gov/fdsys/pkg/FR-2000-09-22/pdf/00-24442.pdf', 'https://www.federalregister.gov/articles/xml/002/444/2.xml', '<NOTICE>\n      <PREAMB>\n        <AGENCY TYPE="S">DEPARTMENT OF THE TREASURY</AGENCY>\n        <SUBAGY>Internal Revenue Service</SUBAGY>\n        <SUBJECT>Proposed Collection; Comment Request for Form 8854</SUBJECT>\n        <AGY>\n          <HD SOURCE="HED">AGENCY:</HD>\n          <P>Internal Revenue Service (IRS), Treasury.</P>\n        </AGY>\n        <ACT>\n          <HD SOURCE="HED">ACTION:</HD>\n          <P>Notice and request for comments.</P>\n        </ACT>\n        <SUM>\n          <HD SOURCE="HED">SUMMARY:</HD>\n          <P>The Department of the Treasury, as part of its continuing effort to reduce paperwork and respondent burden, invites the general public and other Federal agencies to take this opportunity to comment on proposed and/or continuing information collections, as required by the Paperwork Reduction Act of 1995, Public Law 104-13 (44 U.S.C. 3506(c)(2)(A)). Currently, the IRS is soliciting comments concerning Form 8854, Expatriation Information Statement.</P>\n        </SUM>\n        <DATES>\n          <HD SOURCE="HED">DATES:</HD>\n          <P>Written comments should be received on or before November 21, 2000 to be assured of consideration.</P>\n        </DATES>\n        <ADD>\n          <HD SOURCE="HED">ADDRESSES:</HD>\n          <P>Direct all written comments to Garrick R. Shear, Internal Revenue Service, room 5244, 1111 Constitution Avenue NW., Washington, DC 20224.</P>\n        </ADD>\n        <FURINF>\n          <HD SOURCE="HED">FOR FURTHER INFORMATION CONTACT:</HD>\n          <P>Requests for additional information or copies of the form and instructions should be directed to Martha R. Brinson, (202) 622-3869, Internal Revenue Service, room 5244, 1111 Constitution Avenue NW., Washington, DC 20224.</P>\n        </FURINF>\n      </PREAMB>\n      <SUPLINF>\n        <HD SOURCE="HED">SUPPLEMENTARY INFORMATION:</HD>\n        <P SOURCE="NPAR">\n          <E T="03">Title:</E>Expatriation Information Statement OMB Number: 1545-1567.</P>\n        <P>\n          <E T="03">Form Number:</E>Form 8854.</P>\n        <P>\n          <E T="03">Abstract:</E>Internal Revenue Code Section 6039G requires persons who lose U.S. citizenship to provide information concerning citizenship, income tax liability, net worth, and net assets. Form 8854 is used to report this information.</P>\n        <P>\n          <E T="03">Current Actions:</E>There are no changes being made to the form at this time.</P>\n        <P>\n          <E T="03">Type of Review:</E>Extension of a currently approved collection.</P>\n        <P>\n          <E T="03">Affected Public:</E>Individuals or households.</P>\n        <P>\n          <E T="03">Estimated Number of Respondents&#x2014;Part I:</E>10,000.</P>\n        <P>\n          <E T="03">Estimated Number of Respondents&#x2014;Parts I and II:</E>1,000.</P>\n        <P>\n          <E T="03">Estimated Time Per Respondent&#x2014;Part I:</E>1 hr., 46 min.</P>\n        <P>\n          <E T="03">Estimated Time Per Respondent&#x2014;Parts I and II:</E>7 hr., 8 min.</P>\n        <P>\n          <E T="03">Estimated Total Annual Burden Hours:</E>23,060.</P>\n        <P>The following paragraph applies to all of the collections of information covered by this notice:</P>\n        <P>An agency may not conduct or sponsor, and a person is not required to respond to, a collection of information unless the collection of information displays a valid OMB control number. Books or records relating to a collection of information must be retained as long as their contents may become material in the administration of any internal revenue law. Generally, tax returns and tax return information are confidential, as required by 26 U.S.C. 6103.</P>\n        <P>\n          <E T="03">Request for Comments:</E>Comments submitted in response to this notice will be summarized and/or included in the request for OMB approval. All comments will become a matter of public record. Comments are invited on: (a) Whether the collection of information is necessary for the proper performance of the functions of the agency, including whether the information shall have practical utility; (b) the accuracy of the agency''s estimate of the burden of the collection of information; (c) ways to enhance the quality, utility, and clarity of the information to be collected; (d) ways to minimize the burden of the collection of information on respondents, including through the use of automated collection techniques or other forms of information technology; and (e) estimates of capital or start-up costs and costs of operation, maintenance, and purchase of services to provide information.</P>\n        <SIG>\n          <DATED>Approved: September 18, 2000.</DATED>\n          <NAME>Garrick R. Shear,</NAME>\n          <TITLE>IRS Reports Clearance Officer.</TITLE>\n        </SIG>\n      </SUPLINF>\n      <FRDOC>[FR Doc. 00-24442 Filed 9-21-00; 8:45 am]</FRDOC>\n      <BILCOD>BILLING CODE 4830-01-P</BILCOD>\n    </NOTICE>', 'Proposed Collection; Comment Request for Form 8854', ' &#8230; .\nAbstract: Internal Revenue Code Section <span class="match">6039G</span> requires persons who lose U &#8230; ', '[{"parent_id":null,"json_url":"https://www.federalregister.gov/api/v1/agencies/497.json","url":"https://www.federalregister.gov/agencies/treasury-department","name":"Treasury Department","raw_name":"DEPARTMENT OF THE TREASURY","id":497},{"parent_id":497,"json_url":"https://www.federalregister.gov/api/v1/agencies/254.json","url":"https://www.federalregister.gov/agencies/internal-revenue-service","name":"Internal Revenue Service","raw_name":"Internal Revenue Service","id":254}]', '00-24442', 'The Department of the Treasury, as part of its continuing effort to reduce paperwork and respondent burden, invites the general public and other Federal agencies to take this opportunity to comment on proposed and/or continuing information collections, as required by the Paperwork Reduction Act of 1995, Public Law 104-13 (44 U.S.C. 3506(c)(2)(A)). Currently, the IRS is soliciting comments concerning Form 8854, Expatriation Information Statement.', NULL),
